import React, { PureComponent, Fragment } from 'react';
import './App.css';
import Terminal from'./Terminal/Terminal'

class App extends PureComponent {

  render () {
    return (
    <div id="app">
      <h1>Welcome to an Interactive Portfolio</h1>
      <ul id="navBar">
                <li>Terminal  x</li>
                <li>About</li>
                <li>Experience</li>
                <li>Work</li>
            </ul>
      <Terminal></Terminal>
    </div>
    );
  }
}

export default App;
